import React from 'react'
import "./Description.css";
import phonee from "../../../Image/phonee.svg";


const Description = () => {
    return ( 
        <div className="container">
        <div className="row">
            <div className="col desc">
                <div className="row">
                <div className="col-lg ">
                    <img src={phonee} alt="" width="300" className="image"/>
                </div>
                <div className="col-lg">
                    <p>Lorem, ipsum dolor sit amet consectetur adipisicing elit. Ratione voluptate laudantium similique quos hic voluptatem facere ipsam numquam autem possimus tempore, exercitationem pariatur magnam facilis cupiditate eos illo, asperiores odio alias voluptatum. Ut veritatis error maxime vel aspernatur nihil perspiciatis!</p>
                </div>
                </div>
            </div>
        </div>
        </div>
     );
}

export default Description;
